  false,\n\t\"url\": null,\n\t\"notes\": \"A cultural resources survey was conducted
  at Prime Hook National Wildlife Refuge, Sussex County, during the late summer of
  1981. This work concentrated on the determination of impact of three refuge improvement
  projects. The objective of the work was to determine if any prehistoric or early
  historic sites or potential sites existed at shallow depths below the recently encroached
  marsh mucks of the three development areas.\",\n\t\"license_title\": \"License Not
